import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Dashboard = () => {
  const [statusCounts, setStatusCounts] = useState({ open: 0, inProgress: 0, closed: 0 });

  useEffect(() => {
    const fetchStatusCounts = async () => {
      try {
        const response = await axios.get('/api/tickets/dashboard/all');
        setStatusCounts(response.data.statusCounts);
      } catch (error) {
        console.error('Error fetching status counts:', error);
      }
    };

    fetchStatusCounts();
  }, []);

  return (
    <div>
      <h1>Admin Dashboard</h1>
      <table>
        <thead>
          <tr>
            <th>Status</th>
            <th>Count</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Open</td>
            <td>{statusCounts.open}</td>
          </tr>
          <tr>
            <td>In Progress</td>
            <td>{statusCounts.inProgress}</td>
          </tr>
          <tr>
            <td>Closed</td>
            <td>{statusCounts.closed}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default Dashboard;
